import React from 'react';
import {
  ProjectContainer, ProjectTitle, LinksContainer, GradientButton,
  Description, DemonstrationContainer, StepsContainer, StepItem,
  StepDescription, GifContainer, GifImage, Card, PillBadge,
  GradientBackground, CircleExpand, TextMod, GradientText,
  GradientContainer, AnimatedGradient, LineHeightText, HoverColorShift,
  DashedContainer, Subtitle, FlexRow, Divider, GlassCard,ChangeTextColorOnHover
} from './StyledComp';

const dummyData = {
  title: "Sample Project",
  websiteLink: "http://example.com",
  githubLink: "http://github.com/sample",
  demoLink: "http://youtube.com/watch?v=demo",
  description: "This is a sample project description. It explains the purpose and functionality of the project in brief.",
  demonstration: [
    {
      description: "Step 1: User Registration",
      gifImage: "path/to/registration-demo.gif"
    },
    {
      description: "Step 2: User Login and Dashboard Overview",
      gifImage: "path/to/login-demo.gif"
    }
  ]
};
const Project = () => {
    const { title, websiteLink, githubLink, demoLink, description, demonstration } = dummyData;
  
    return (
      <GradientBackground> {/* The entire project has a gradient background */}
        <CircleExpand>🔵</CircleExpand> {/* Circle animation in the corner */}
        
        <Card>
          <ProjectContainer>
            <FlexRow>
              <ProjectTitle>
                {/* Styled with GradientText and TextMod */}
                <GradientText>
                  <TextMod size="2.5rem" color="#444" weight="bold">
                    {title}
                  </TextMod>
                </GradientText>
              </ProjectTitle>
              <PillBadge>NEW</PillBadge>
            </FlexRow>
  
            {/* Centered links with GradientButton and AnimatedGradient */}
            <GradientContainer>
              <LinksContainer>
                <AnimatedGradient>
                <ChangeTextColorOnHover hoverColor="green">
                                  <GradientButton href={websiteLink}>Website</GradientButton>
                                  </ChangeTextColorOnHover>
                </AnimatedGradient>
                
                <AnimatedGradient>
                  <GradientButton href={githubLink}>GitHub</GradientButton>
                </AnimatedGradient>
                
                {demoLink && (
                  <AnimatedGradient>
                    <GradientButton href={demoLink}>Demonstration</GradientButton>
                  </AnimatedGradient>
                )}
              </LinksContainer>
            </GradientContainer>
  
            <LineHeightText>Line height sample text</LineHeightText>
  
            <DashedContainer>
              <Description>
                <TextMod size="1.2rem" color="#666" font="Verdana, sans-serif" weight="500">
                  This is a <TextMod color="#444" weight="bold">sample</TextMod> project description. It explains the purpose and functionality of the project in brief.
                </TextMod>
              </Description>
            </DashedContainer>
  
            {demonstration && (
              <DemonstrationContainer>
                <GlassCard>
                  <Subtitle>Demonstration:</Subtitle>
                  <StepsContainer>
                    {demonstration.map((step, index) => (
                      <StepItem key={index}>
                        <StepDescription>
                          <HoverColorShift>
                            <TextMod type="italic">{step.description}</TextMod>
                          </HoverColorShift>
                        </StepDescription>
                        <GifContainer>
                          <GifImage src={step.gifImage} alt={`Demo for step ${index + 1}`} />
                        </GifContainer>
                      </StepItem>
                    ))}
                  </StepsContainer>
                </GlassCard>
              </DemonstrationContainer>
            )}
            <Divider />
          </ProjectContainer>
        </Card>
      </GradientBackground>
    );
  };
  
  export default Project;
